import React from 'react';
import { Box, Typography } from '@mui/material';

const ContactPage = () => {
  return (
    <Box sx={{ padding: 4 }}>
      <Typography variant="h4" gutterBottom>
        Контакты
      </Typography>
      <Typography variant="body1" paragraph>
        Мы всегда рады помочь! Свяжитесь с нами по следующим каналам:
      </Typography>
      <ul>
        <li>Телефон: +7 (800) 123-45-67</li>
        <li>Электронная почта: info@technosystems.com</li>
        <li>Адрес: г. Барнаул, пр-кт Калинина, д. 116/44</li>
      </ul>
    </Box>
  );
};

export default ContactPage;
